pragma solidity ^0.5.0;

contract D {
    
    string public name;
    string public license_number;
    int public serial_number;
  
  function getword() view public returns(string memory, string memory, int) {
      return (name, license_number, serial_number) ;
  }
  
   function setword(string memory Newword, string memory LNUMBER, int SNUMBER) public returns(string memory, string memory, int) {
       name = Newword;
       license_number= LNUMBER;
       serial_number= SNUMBER;
       return (name, license_number, serial_number);
   }
    
}
